          body: "# Release v0.117.0\n\n## \U0001F680 Features\n\n- Add support for
            me-central-1 (#5837)\n- Add option to preserve addon config during update
            (#5830)\n\n## \U0001F3AF Improvements\n\n- Added networking.k8s.io api
            to allowlist ingress operations (#5834)\n- Add ready plugin to CoreDNS
            and use health.lameduck for a safer shutdown (#5695)\n\n## \U0001F41B
            Bug Fixes\n\n- Preserve existing version during addon update when a version
            is not provided (#5803)\n- Fix max-pods for managed nodegroups (#5808)\n-
            Fix adding taints and labels as ASG tags (#5781)\n\n## Acknowledgments\nWeaveworks
            would like to sincerely thank:\n@singhbhaskar, and @wind0r\n"
