          body: "# Release v0.124.0\n\n## \U0001F680 Features\n\n- Add support for
            Windows managed nodegroups (#5935)\n- Add support for utils describe-addon-configuration
            (#6056)\n- Add support for advanced configuration for add-ons (#6049)\n-
            Add support for new spot allocation strategies (#6038)\n\n## \U0001F3AF
            Improvements\n\n- Write kubeconfig lock file to tmp so that it gets automatically
            cleaned up (#6030)\n\n## \U0001F9F0 Maintenance\n\n- Improve unit test
            coverage for private cluster (#6028)\n\n## \U0001F4DD Documentation\n\n-
            Add logRetentionInDays in cloudwatch cluster logging docs (#6037)\n\n##
            Acknowledgments\nWeaveworks would like to sincerely thank:\n@jiechen0826
            and @matti \n\n"
