          body: "# Release v0.134.0\n\n## \U0001F680 Features\n\n- Add support for
            Melbourne (ap-southeast-4) (#6400)\n- Make 1.25 the default Kubernetes
            version (#6374)\n\n## \U0001F3AF Improvements\n\n- Improve messages during
            creation of iamserviceaccount (#5856)\n\n## \U0001F41B Bug Fixes\n\n-
            Use correct image path in coredns manifest (#6392)\n- Add condition to
            restrict fargate pod execution role to source arn (#6375)\n\n## \U0001F9F0
            Maintenance\n\n- Add integration tests for addons in a cluster with no
            nodes (#6378)\n\n## Acknowledgments\nWeaveworks would like to sincerely
            thank:\n     @programmer04\n\n"
