          body: "# Release v0.144.0\n\n## \U0001F680 Features\n\n- Allow creating
            subnets with resource-based hostnames (#6651)\n\n## \U0001F3AF Improvements\n\n-
            Updated IAM policy statement for loadbalancer controller (#6655)\n- Port
            Add ready plugin to CoreDNS and use health.lameduck for a safer shutdown
            to 1.25, 1.26 and 1.27 (#6630)\n\n## \U0001F41B Bug Fixes\n\n- Only retry
            on appropriate API Errors when calling `eks:DescribeUpdate` (#6645)\n-
            Clean up ALBs using `spec.ingressClassName` and ALB security groups (#6389)\n-
            Set default Windows volume name to /dev/sda1 (#6638)\n\n\n## \U0001F9F0
            Maintenance\n\n- Fix logging stack events logic for Trainium and Inferentia
            integration tests (#6649)\n- Bump schemer from v0.0.0-2021 to v0.0.0-2023
            (#6646)\n\n## \U0001F4DD Documentation\n\n- Generated ATTRIBUTIONS.md
            file (#6647)\n\n## Acknowledgments\nWeaveworks would like to sincerely
            thank:\n  @aaroniscode, @joneidaws and @wind0r\n\n"
