          body: "# Release v0.148.0\n\n## \U0001F680 Features\n\n- Add support for
            `us-iso-east-1` and `us-isob-east-1` regions (#6759)\n\n## \U0001F3AF
            Improvements\n\n- Replaced weaveworksbot with eksctlbot in workflows and
            actions (#6758)\n\n## \U0001F41B Bug Fixes\n\n- Fix index out of range
            error when aws-node, kube-proxy or coredns are missing (#6756)\n\n## \U0001F9F0
            Maintenance\n\n- Bump dependencies (#6754, #6742)\n- Migrate to sdk v2
            - configuration loading (#6432)\n\n## \U0001F4DD Documentation\n\n- Fix
            documentation for EKS interface endpoint (#6747)\n- Added new logo and
            favicon assets (#6746)\n\n## Acknowledgments\nWeaveworks would like to
            sincerely thank:\n  @wind0r\n\n\n"
