          body: "# Release v0.173.0\n\n## \U0001F680 Features\n\n- Make EKS 1.29 default
            (#7599)\n\n## \U0001F3AF Improvements\n\n- Add profile flag support for
            get and delete access entry (#7623)\n- Remove inline ELB and CloudWatch
            policies from Cluster Role (#7603)\n\n## \U0001F41B Bug Fixes\n\n- Increase
            STS session duration to fix caching credentials with assumed role MFA
            session (#7626)\n\n## \U0001F9F0 Maintenance\n\n- Automate PR with release
            notes draft (#7604)\n\n## \U0001F4DD Documentation\n\n- Update docs with
            Ubuntu 20.04 supported in EKS \\<= 1.29 (#7618)\n\n## Acknowledgments\n\nThe
            eksctl maintainers would like to sincerely thank @ibnjunaid, @rpocase
            and @vutny.\n\n\n"
