          body: "# Release v0.176.0\n\n## \U0001F680 Features\n\n- Add support for
            AMIs based on AmazonLinux2023 (#7684)\n\n## \U0001F3AF Improvements\n\n-
            Display full draft release notes in PR description (#7686)\n\n## \U0001F41B
            Bug Fixes\n\n- Enforce `authenticationMode:CONFIG\\_MAP` on Outposts (#7699)\n-
            [EKSCTL create cluster command] Authorise self-managed nodes via `aws-auth
            configmap` when EKS access entries are disabled (#7698)\n- Allow GPU instance
            types for Windows nodes (#7681)\n- Include MixedInstancesPolicy LaunchTemplate
            for validation (#7661)\n- Aim for namespace uniqueness across parallel
            integration tests specs (#7680)\n\n## \U0001F9F0 Maintenance\n\n- Bump
            mkdocs version (#7696)\n- Bump dependencies (#7668)\n\n## Acknowledgments\n\nThe
            eksctl maintainers would like to sincerely thank @qclaogui.\n\n\n"
