          body: "# Release v0.199.0\n\n## \U0001F680 Features\n\n- Support EKS managed
            nodegroup node repair config (#8087)\n- Add support for C8g and R8g instance
            types (#8041)\n- Add support for `overrideBootstrapCommand` in AL2023
            (#8078)\n\n## \U0001F41B Bug Fixes\n\n- Allow importing subnets with IPv6
            only (#8086)\n- EKS Auto Mode should not require setting default addons
            or OIDC (#8082)\n\n## Acknowledgments\n\nThe eksctl maintainers would
            like to sincerely thank @cheeseandcereal and @muhammetssen.\n\n\n"
