          body: "# Release v0.201.0\n\n## \U0001F680 Features\n\n- Ubuntu 24.04 support
            (#8094)\n- Support create cluster default addon metrics-server (#8118)\n-
            Support for Mexico region (mx-central-1) (#8117)\n\n## \U0001F41B Bug
            Fixes\n\n- Remove EFA installation scripts; EFA is installed by default
            on EKS AL2 GPU, EKS Al2023 NVIDIA, and EKS AL2023 Neuron AMIs (#8113)\n-
            Repair AL2023 with IPv6 node creation (#8120)\n\n## \U0001F9F0 Maintenance\n\n-
            Update nvidia-device-plugin to v0.17.0 (#7918)\n- Update aws-node to v1.19.2
            (#7899)\n- Update coredns (#7901)\n\n## \U0001F4DD Documentation\n\n-
            Update doc dependencies and supported Python runtime to publish latest
            doc updates (#8119)\n\n## Acknowledgments\n\nThe eksctl maintainers would
            like to sincerely thank @bryantbiggs, @gustavodiaz7722 and @toabctl.\n\n\n"
