          body: "# Release v0.202.0\n\n## \U0001F680 Features\n\n- Support for us-isof
            and eu-isoe regions (#8151)\n- Enable default addon creation for auto
            mode clusters (#8140)\n\n## \U0001F3AF Improvements\n\n- Use `DescribeClusterVersions`
            API instead of hardcoding EKS version data (#8144)\n\n## \U0001F41B Bug
            Fixes\n\n- Wait for vpccni to become active before updating it to use
            IRSA (#8152)\n- Update import path of local goformation fork, fixing `go
            mod verify` (#8148)\n- Disable metrics-server default addon creation for
            unsupported regions (#8146)\n\n## Acknowledgments\n\nThe eksctl maintainers
            would like to sincerely thank @jdwtf\n\n"
