          body: "# Release v0.204.0\n\n## \U0001F680 Features\n\n- Enable NVIDIA Plugin
            automatically for AL2023 GPU AMIs (#8199)\n- Added EBS IO2 volumeType
            support to Managed  NodeGroup (#7989)\n- Enable Bottlerocket on Neuron
            Instance types (Inferentia and Trainium) (#8173)\n\n## \U0001F3AF Improvements\n\n-
            pre-Generate EC2 instance type details out of band (#8206)\n- New EFA
            plugin images need a new volume for EFA plugin to mount - `/dev/infiniband`
            (#8201)\n- Add addon name to some logging lines (#8200)\n\n## \U0001F9F0
            Maintenance\n\n- Update building with golang 1.24 (#8210)\n- Update aws-node
            to v1.19.2 (#8160)\n\n## Acknowledgments\n\nThe eksctl maintainers would
            like to sincerely thank @BhowmickSumit, @Juneezee, @alexandear, @dims
            and @vigh-m.\n\n\n"
