          body: "# Release v0.205.0\n\n## \U0001F680 Features\n\n- Add support for
            creating access entries of type `EC2` for EKS Auto Mode (#8228)\n- Support
            for setting MarketType/InstanceMarketOptions for use with capacity-block
            (#8207)\n\n## \U0001F3AF Improvements\n\n- Update eksctl api schema for
            neuron devices (#8255)\n- Fix go.sum; check go.mod and go.sum on CI (#8254)\n-
            Switch default for ExecConfig api version from v1alpha1->v1beta1 (#8252)\n-
            Allow separate explicit selection of Neuron Devices (separate from GPUs)
            in api (#8243)\n- Add support for allow/deny regexp(s) in instanceSelector
            (#8247)\n- Re-add support for env var keys from AWS SDK (#8231)\n\n##
            \U0001F41B Bug Fixes\n\n- Allow adding remote network config to private
            clusters (#8261)\n- Re-allow use of the `cnn1-az4` availability zone (#8240)\n-
            Add missing coredns-1.32 json file (#8233)\n- Print the computed upgrade
            version correctly (#8232)\n- Remove support for p2 instances which require
            NVIDIA driver \\<= 470 (#8226)\n- Fix issue installing the nvidia device
            plugin unconditionally on al2023 (#8225)\n- Do not create a placement
            group when using a reservation (#8220)\n\n## \U0001F9F0 Maintenance\n\n-
            Update aws-node to v1.19.3 (#8258)\n\n## \U0001F4DD Documentation\n\n-
            Update Karpenter usage documentation to reflect latest supported version(s)
            (#8250)\n\n## Acknowledgments\n\nThe eksctl maintainers would like to
            sincerely thank @NicholasBlaskey, @alexandear, @bryantbiggs, @cenkalti,
            @dims, @escardoso and @vsoch.\n\n"
