          body: "# Release v0.206.0\n\n## \U0001F680 Features\n\n- Allow specification
            of IAM permission boundary for Auto Mode's Node Role (#8307)\n\n## \U0001F3AF
            Improvements\n\n- Default to newest k8s 1.32 version (#8300)\n- Support
            for EKS internal environments (#8294)\n- Update goformation from latest
            schema / Remove unused generated code (#8289)\n- Reduce blast radius of
            test that disables api server public access failing (#8288)\n- Fix failure
            when VPC CNI is configured to use both iam.withOIDC and useDefaultPodIdentityAssociations
            (#8268)\n- Update zz\\_generated.deepcopy.go, also add new make target
            for the same (#8267)\n\n## \U0001F41B Bug Fixes\n\n- Skip instance type
            support validation for custom AMI ID (#8303)\n- Allow core/default networking
            addons on auto-mode clusters with mixed node types (#8293)\n- Standardize
            on k8s 1.32.2 for go.mod (#8285)\n\n## \U0001F9F0 Maintenance\n\n- Add
            support for i8g.48xlarge ec2 instance type (#8301)\n- Update nvidia-device-plugin
            to v0.17.1 (#8296)\n- Update ec2-info (#8297)\n- Update ec2-info (#8290)\n\n##
            Acknowledgments\n\nThe eksctl maintainers would like to sincerely thank
            @amdonov, and @ndbaker1.\n\n\n"
