          body: "# Release v0.208.0\n\n## \U0001F680 Features\n\n- Enable enclave
            options in EC2 Launch Template (#8349)\n- Add support for AL2023 arm64
            nvidia amiType  (#8351)\n\n## \U0001F3AF Improvements\n\n- Add AmazonLinux2
            end-of-life warning message when creating clusters and nodegroups (#8376)\n\n##
            \U0001F41B Bug Fixes\n\n- Fix for `create podidentityassociation` bug
            in auto-mode clusters (#8358)\n- Fix CoreDNS scheduling on Fargate failing
            when component label in selector (#8357)\n- Fix support for non-current-generation
            ec2 instance types (#8354)\n- Fix get iamserviceaccount returning error
            for unrelated CloudFormation Stack (#8350)\n\n## \U0001F9F0 Maintenance\n\n-
            Update coredns default to v1.11.4-eksbuild.10 (#8363)\n- Update ec2-info
            (#8361)\n- Drop support for Ubuntu 18.04 images (#8344)\n\n## \U0001F4DD
            Documentation\n\n- Update binary install for best practices (#8359)\n\n##
            Acknowledgments\n\nThe eksctl maintainers would like to sincerely thank
            @cloudxabide, @dheeraj-coding, @naclonts, @ndbaker1, @tarikdem and @toabctl.\n\n\n"
