          body: "# Release v0.209.0\n\n## \U0001F3AF Improvements\n\n- Add eksctl
            support for new AWS region ap-east-2 (#8406)\n\n## \U0001F41B Bug Fixes\n\n-
            Use AmazonLinux2023 as default AMI instead of AmazonLinux2 for Kubernetes
            version >=1.33 (#8405)\n- Fix missing permission setup for IPv6 cluster
            (#8387)\n\n## \U0001F9F0 Maintenance\n\n- Update aws-node to v1.19.5 (#8377)\n-
            Update nvidia-device-plugin to v0.17.2 (#8381)\n- Update ec2-info (#8382)\n-
            Update coredns (#8385)\n\n## \U0001F4DD Documentation\n\n- Fix missing
            permission setup for IPv6 cluster (#8387)\n\n## Acknowledgments\n\nThe
            eksctl maintainers would like to sincerely thank @guessi and @naclonts.\n\n\n"
