          body: "# Release v0.211.0\n\n## \U0001F3AF Improvements\n\n- Migrate EBS
            CSI policy to AmazonEBSCSIDriverPolicy managed policy (#8422)\n- Add support
            for custom Bottlerocket AMIs for MNG (#8418)\n- Implementation of MCP
            server for eksctl (#8414)\n\n## \U0001F41B Bug Fixes\n\n- Add DescribeRouteTables
            to load balancer controller permissions (#8447)\n\n## \U0001F9F0 Maintenance\n\n-
            Update coredns (#8437)\n- Update aws-node to v1.20.0 (#8426)\n- Update
            ec2-info (#8427)\n\n## \U0001F4DD Documentation\n\n- Update schema.md
            (#8443)\n- add note about docs migration (#8441)\n- Add announcement for
            docs on AWS, remove old announcements (#8442)\n- Fix link URL for privateNetworking
            (#8416)\n\n## Acknowledgments\n\nThe eksctl maintainers would like to
            sincerely thank @ConnorJC3, @NicholasBlaskey, @geoffcline, @koooosh and
            @mgalgs.\n\n\n"
