          body: "# Release v0.215.0\n\n## \U0001F680 Features\n\n- automatic security
            group tagging for karpenter (#8501)\n\n## \U0001F3AF Improvements\n\n-
            fix: use default security group for eks 1.33+ when EFA is enabled (#8509)\n-
            fix: karpenter tagging, addons and flaky integration tests (#8508)\n\n##
            \U0001F41B Bug Fixes\n\n- fix: match cloudformation stack name using suffix
            for pod identity association  (#8511)\n- fix: Add exact match check to
            use specified addon versions (#8510)\n- fix: Fix GPU instance filtering
            when --instance-selector-gpus=0 (#8506)\n- fix: use latest managed addon
            version for kube-proxy image name (#8505)\n\n## \U0001F9F0 Maintenance\n\n-
            Update aws-node to v1.20.3 (#8471)\n- Update nvidia-device-plugin to v0.17.4
            (#8453)\n- Update coredns (#8472)\n- Update ec2-info (#8454)\n\n## \U0001F4DD
            Documentation\n\n- docs: Add Auto Mode behavior change notices (#8513)\n-
            Revert Add scheduled maintenance announcement for eksctl.io (#8500)\n-
            Add scheduled maintenance announcement for eksctl.io (#8498)\n\n## Acknowledgments\n\nThe
            eksctl maintainers would like to sincerely thank and @sapphirew.\n\n\n"
