          body: "# Release v0.216.0\n\n## \U0001F680 Features\n\n- Add support for
            ap-southeast-6 (#8544)\n- feat: add support for UpgradePolicy attribute
            in cluster creation (#8534)\n\n## \U0001F3AF Improvements\n\n- Fix upgrade
            vpc-cni test relying on assumptions about vpc versions (#8562)\n- Fix
            integration test by waiting 2 minutes for ebs update (#8561)\n- Fix test
            failure for add-on waiting for ebs csi driver (#8559)\n- For dns test,
            use an ECR busybox image (#8560)\n- Don't check access entry length to
            fix failed intg test (#8558)\n- Don't wait for metrics-server if its the
            only add-on (#8552)\n- Migrate completly off V1 SDK to V2 SDK (#8548)\n\n##
            \U0001F41B Bug Fixes\n\n- Make update kube-proxy not use minimal images
            for >= 1.34 (#8557)\n- Remove kubernetes.io/cluster/\\<clusterName> tag
            from EFA security group (#8556)\n- Create EFA specific security group
            for self-managed node groups always (#8554)\n- Make metrics server create
            after node groups so it can get scheduled  (#8538)\n\n## \U0001F9F0 Maintenance\n\n-
            Don't check access entry length to fix failed intg test (#8558)\n- Update
            coredns (#8537)\n- Migrate completly off V1 SDK to V2 SDK (#8548)\n\n##
            Acknowledgments\n\nThe eksctl maintainers would like to sincerely thank
            @NicholasBlaskey and @guessi.\n\n\n"
